import React from 'react'
import { Row } from 'react-bootstrap'
import { useAuth } from '../../../../AuthContext'

const Profile = () => {
    const { userDetails } = useAuth()
    return (
        <div>
            <h3>My Profile</h3>
            <Row class='border-between'></Row>
        </div>
    )
}

export default Profile
